import React, {Component} from 'react';

class Resultado extends Component {
    mostrarImagenes= () => {
        console.log(this.props.imagenes);
    }
   
    render() { 
        return (
            <React.Fragment>
            { this.mostrarImageness}
            </React.Fragment>
        );
    }
}
 
export default Resultado;
